  const totalBill = parseFloat(localStorage.getItem("totalbill")) || 0; // Use 0 if not found
  const itemsBought = parseInt(localStorage.getItem("itemsbought"), 10) || 0; // Use 0 if not found

  return (
    <div className="container">
      <h1>Your total is ${totalBill}</h1>
      <p>The items you bought are: {itemsBought}</p>
    </div>
  );
}
